import React from 'react';
import './NewRestTimer.scss';
import { prettyDisplayTime } from '../utils/displayHelpers';

const newRestTimer = props => {
  let totalSeconds = 179;
  function startTimer() {
    props.startTimer("rest", totalSeconds);
    props.toggleModal();
  }

  return (
    <div id="new-rest-timer">
      <div className="timer-display">{prettyDisplayTime(totalSeconds)}</div>
      <button type="button" className="button-one time-change-button">- 30 Sec</button>
      <button type="button" className="button-one time-change-button">+ 30 Sec</button>
      <button type="button" onClick={props.toggleModal} className="button-one action-button">SKIP </button>
      <button type="button" onClick={startTimer} className="button-one action-button">
        START
      </button>
    </div>
  );
};

export default newRestTimer;
